pragma solidity ^0.4.24;

contract fileshare {
    address owner;
    mapping(address=>string) key_share;     //stores keys
    mapping(address=>string) data_share;    //stores data

    constructor () public {
        owner=msg.sender;
    }

    function register (string pk) public{
        key_share[msg.sender]=pk;
    }

    function get_pk (address alice) public constant returns (string){
        require(msg.sender==owner,"You have no access");
        require(bytes(key_share[alice]).length>0,"There is no record");
        return key_share[alice];
    }

    function share_data (address alice, string data) public {
        require(msg.sender==owner,"You have no access");
        data_share[alice]=data;
    }

    function get_data () public constant returns (string){
        require(bytes(key_share[msg.sender]).length>0,"There is no record");
        return data_share[msg.sender];
    }
}
